import React from "react";
import Item from "./Item";

function Table(props) {
  const rows = [];
  for (let i = 0; i < props.length; i++) {
    rows.push(<Item id={i} />);
  }

  return (
    <table>
      <thead>
        <tr>
          <th>Name</th>
        </tr>
      </thead>
      <tbody>{rows}</tbody>
    </table>
  );
}

export default Table;
